import React from 'react';

import './Error.css'
import icon from './errorBike1.png'

const Error = () => {
    return (
        <div className="mainError d-flex">
            <img src={icon} alt="error-icon" />
            <span>Probably someone put a stick in the server</span>
        </div>
    );
};

export default Error;
